import './navitems.css'



const Nav = (props) => {
  return (
<li className='nav-item'>
    {props.children}
</li>
  )
}




const NavDropDown = (props) => {
    return (
  <li className='dropdown-item'>
      {props.children}
  </li>
    )
  }

export default Nav
export {NavDropDown}
